import React from 'react';
import './home.css';

export default function() {
  return (
    <div className='home'>
            <p className="card-text"><h1>Welcome to BENGO where everything you need is available.
            </h1>
              Browse our categories for more specific items, 
            <br></br>Add to cart and keep browsing.
            <br></br>At any time you can visit the cart to modify your shopping items and proceed to the checkout.</p>
            <div className='visit'>Now visit the products section from the product menu in the top.</div>
    </div>
  )
}
